import React from "react";
import "./Register.css"

function FormReg() {
	return (
		<div className="FormContainer">
			<form className="NewRegister">
				<input className='input inpname' placeholder='NAME' />
				<input className='input inpLastName' placeholder="LAST NAME"/>
				<input className='input inpNickName' placeholder="NICK NAME"/>
				<input className='inputinpEmail' placeholder="E-MAIL"/>
				<input className='inputinpPassword' placeholder="PASSWORD"/>
				<input className='input inpDate' placeholder="DATE OF BIRTH"/>
				<button className="conectGoogle" type="button" placeholder="button">Conect With Google!</button>
				<button className="conectFace" type="button" placeholder="button">Conect With Facebook!</button>
			</form>
		</div>
	)
}

export { FormReg }
